import React from 'react';
// import ReactDOM from 'react-dom/client';
import './App.css';

class Compclass extends React.Component {
  xText = 'Kintamojo tekstas'
  render() {
    return (
      <header>{this.props.xInfo}
        <h2 onClick={this.mouseOver}>
          {this.xText}</h2>
      </header>
    )
  }
  mouseOver() { console.log('Pelė ant tksto') }
}

function App() {
  return (
    <div className="App">
      <Compclass xInfo='info' />
      <Compclass xInfo='info !!!' />
      <header className="App-header">
        hello
      </header>
    </div>
  );
}

export default App;
